import React from 'react';
import styles from './Sidebar.module.css';

const Sidebar = ({ index, item }) => {
  return (
    <li key={index} className={styles[item.className]} onClick={showSidebar}>
      <Link to={item.path}>
        {item.icon}
        <span>{item.title}</span>
      </Link>
    </li>
  );
};

export default Sidebar;
